import React, { Component } from 'react';
import styleGlasses from "./Glasses.module.css"
class Glasses extends Component {
  render() {
    return (
      <div className={styleGlasses.glasses}>
        <button>
          <img
            src="https://images.unsplash.com/photo-1672681149507-d7bf765e9533?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
            alt=""
            className={styleGlasses.button__image}
          />
        </button>
        <button>
          <img
            src="https://images.unsplash.com/photo-1672681149507-d7bf765e9533?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
            alt=""
            className={styleGlasses.button__image}
          />
        </button>
      </div>
    );
  }
}

export default Glasses;
